import { Route, Routes } from 'react-router-dom'
import Cart from './Cart';
import MiniCart from "./secondarys/MiniCart";

function checkOut_father() {
    return (
        <>
            <MiniCart />
            <Routes>
                <Route exact path='/checkout/2' element={<Cart />} />
            </Routes>
        </>
    );
}

export default checkOut_father;
